K.Kefka = Class.create(SGF.Sprite, {
    initialize: function($super) {
        $super(K.kefkaSpriteset, {
            spriteX:1,
            spriteY:0,
            width: K.kefkaSpriteset.spriteWidth*1,
            height: K.kefkaSpriteset.spriteHeight*1,
            zIndex:10
        });
        this.mapSpeed = 2;
        this.currentTile = [5,5];
        this.previousTile = null;
        this.state = null;
        this.direction = "S";
        this.x = this.currentTile[0] * K.TILE_SIZE;
        this.y = this.currentTile[1] * K.TILE_SIZE - (this.height - K.TILE_SIZE)-1;
    },
    update: function($super, uc) {
        $super(uc);
        if (this.state) {
            switch (this.state) {
                case "moving":
                    switch (this.direction) {
                        case "N":
                            this.y-=this.mapSpeed;
                            this.spriteX = (Math.abs((((this.currentTile[1] * K.TILE_SIZE)-this.bottom())/K.TILE_SIZE)*3).floor()+1)%3;
                            //SGF.log(this.spriteX);
                            if (this.bottom() % K.TILE_SIZE == 0)
                                this.checkForInput(uc);
                            break;
                        case "S":
                            this.y+=this.mapSpeed;
                            this.spriteX = (Math.abs((((this.currentTile[1] * K.TILE_SIZE)-this.bottom())/K.TILE_SIZE)*3).floor()+1)%3;
                            //SGF.log(this.spriteX);
                            if (this.bottom() % K.TILE_SIZE == 0)
                                this.checkForInput(uc);
                            break;
                        case "W":
                            this.x-=this.mapSpeed;
                            this.spriteX = (Math.abs((((this.currentTile[0] * K.TILE_SIZE)-this.x)/K.TILE_SIZE)*3).floor()+1)%3;
                            //SGF.log(this.spriteX);
                            if (this.x % K.TILE_SIZE == 0)
                                this.checkForInput(uc);
                            break;
                        case "E":
                            this.x+=this.mapSpeed;
                            this.spriteX = (Math.abs((((this.currentTile[0] * K.TILE_SIZE)-this.x)/K.TILE_SIZE)*3).floor()+1)%3;
                            //SGF.log(this.spriteX);
                            if (this.x % K.TILE_SIZE == 0)
                                this.checkForInput(uc);
                            break;
                    }
                    break;
            }
        } else {
            this.checkForInput(uc);
        }
    },
    checkForInput: function() {
        if (SGF.Input.isKeyDown(SGF.Input.KEY_UP)) {
            this.direction = "N";
            this.state = "moving";
            this.spriteY = 1;
            this.previousTile = $A(this.currentTile);
            this.currentTile[1]--;
        } else if (SGF.Input.isKeyDown(SGF.Input.KEY_DOWN)) {
            this.direction = "S";
            this.state = "moving";
            this.spriteY = 0;
            this.previousTile = $A(this.currentTile);
            this.currentTile[1]++;
        } else if (SGF.Input.isKeyDown(SGF.Input.KEY_LEFT)) {
            this.direction = "W";
            this.state = "moving";
            this.spriteY = 2;
            this.previousTile = $A(this.currentTile);
            this.currentTile[0]--;
        } else if (SGF.Input.isKeyDown(SGF.Input.KEY_RIGHT)) {
            this.direction = "E";
            this.state = "moving";
            this.spriteY = 3;
            this.previousTile = $A(this.currentTile);
            this.currentTile[0]++;
        } else {
            this.state = null;
        }
    }
});

